const Mock = require('mockjs');

const Random = Mock.Random;

const attention = function(){
    let commodity = [{
        name:'拖拉机',
        img:require('./../assets/img/拖拉机1.jpg'),
        price:100
    },{
        name:'拖拉机',
        img:'/src/assets/img/拖拉机1.jpg',
        price:100
    }];
    return {
        commodity:commodity
    }
}

Mock.mock('/MyInterestMock','post',attention);
